import React, { useEffect, useState } from "react";
import { BrowserRouter, Routes, Route, Link,
    Outlet
  } from "react-router-dom";
import Home from "./Home";
import Navbar from "./Navbar";

function App() {
    return(
        <div>
            <Navbar />
            <Router>
                <Routes>
                    <Route exact path="/" element={<Home/>}/>
                </Routes>
            </Router>
        </div>
    )
}

export default App;
